import React from "react";
import { Container, Chip, Card, ChipsInput } from "mdbreact";
import DocsLink from "../DocsLink";

class ChipsPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      // No avatars:
      show1: true,
      show2: true,
      show3: true,
      show4: true,
      show5: true,
      show6: true,

      show7: true,
      show8: true,
      show9: true,
      show10: true,
      show11: true,
      show12: true,

      // Named Chips:
      show13: true,
      show14: true,
      show15: true,
      show16: true,
      show17: true,

      // Dates Chips:
      show18: true,
      show19: true,
      show20: true,
      show21: true,

      // Gradient Chips:
      show22: true,
      show23: true,
      show24: true,
      show25: true
    };
  }

  handleCloseHere = param => e => {
    this.setState({
      ["show" + param]: false
    });
  };

  render() {
    const chipsRowStyle1 = { display: "flex", alignItems: "center" };
    const chipsRowStyle2 = {
      display: "flex",
      alignItems: "center",
      justifyContent: "space-around"
    };
    const cardStyle = { maxWidth: "65%", padding: "1.25rem" };

    const {
      show1,
      show2,
      show3,
      show4,
      show5,
      show6,
      show7,
      show8,
      show9,
      show10,
      show11,
      show12,
      show13,
      show14,
      show15,
      show16,
      show17,
      show18,
      show19,
      show20,
      show21,
      show22,
      show23,
      show24,
      show25
    } = this.state;

    return (
      <Container>
        <DocsLink
          title="Chips"
          href="https://mdbootstrap.com/docs/react/components/badges/#chips-avatars"
        />
        <Container>
          <h2 className="my-3">Chips with avatars</h2>

          <Card style={cardStyle}>
            <div style={chipsRowStyle1}>
              <Chip
                src="https://mdbootstrap.com/img/Photos/Avatars/avatar-6.jpg"
                alt="Contact Person"
                waves
              >
                {" "}
                John Doe{" "}
              </Chip>
              <Chip
                size="md"
                src="https://mdbootstrap.com/img/Photos/Avatars/avatar-10.jpg"
                alt="Contact Person"
                waves
              >
                {" "}
                Anna Smith{" "}
              </Chip>
